import React from 'react';
import Input from './inputComponent';
import './ProjetoBase.css';

export default function ProjetoBase() {
  return (
    <div className="container">
      <h2>react-text-transformer</h2>
      <Input id="textoPrincipal" name="Digite:"/>
      <h3>Transformações</h3>
      <Input id="invertido" name="Texto invertido:" />
      <Input id="numerico" name="Texto numérico:" readOnly/>
      <Input id="csv" name="Csv:" readOnly/>
      <Input id="slug" name="Slug:" readOnly/>
      <Input id="vogais" name="Somente vogais:" readOnly/>
      <Input id="consoantes" name="Somente consoantes:" readOnly/>
      <Input id="Variavel" name="Variável:" readOnly/>
      <input id="teste" name="teste" readOnly/>
      <label for="teste">teste</label>
    </div>
  );
}
